import React from 'react'
import Card from '@mui/material/Card';
import { Typography } from '@mui/material';



function MyProfile({user}) {
  return (
    <Card>
      MyProfile
      <Typography>{user.name}</Typography>
      <CardMedia
        component='img'
        height='194'
        image={user.profile}
        alt='Paella dish'
      />
    </Card>
  );
}

export default MyProfile
